import React, { createContext, userContext } from "react";

const initMember = [
  {
    id: "Member",
    name: "조인혁",
    img: "../image/inhyeok.png",
  },
  {
    id: "Member",
    name: "김미성",
  },
  {
    id: "Member",
    name: "김초희",
  },
  {
    id: "Member",
    name: "신성일",
  },
  {
    id: "Member",
    name: "오예진",
  },
  {
    id: "Member",
    name: "마경미",
  },
  {
    id: "president",
    name: "김건훈",
  },
];

const MemberState = createContext();

export default function ContextProvider({ children }) {
  return (
    <MemberState.Provider value={initMember}>{children}</MemberState.Provider>
  );
}

export function useMember() {
  const context = userContext(MemberState);
  return context;
}
